import { BrowserRouter, Routes, Route, Link } from "react-router-dom"
import Register from "./pages/register/Register";

function App() {
  const user = true;
  return (

    <BrowserRouter>
      <Routes>
        <Route exact path="/">
          {user ? <Home /> : <Register />}
        </Route>
      </Routes>


    </BrowserRouter>
  );
}

export default App;
